script: |
  super -f text -I q6890.spq | sort > q6890.out

inputs:
  - name: q6890.spq
    data: |
      SELECT DISTINCT - - col0 + 0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT BETWEEN - col2 + - CAST ( - col1 AS INTEGER ) AND + - 74;
  - name: tab1

outputs:
  - name: q6890.out
    data: |
